import React, { Component } from 'react'
import Letter from "./Letter";
import './App.css';

export class Letters extends Component {

    constructor(string){
        super()
        this.string = ''
    }

    render(){
        return(
            <div>
                <div class='word'>{this.string}</div>
                <Letter />
            </div>
        )
    }
}
